import { Component } from 'react';
import Carousel from 'react-bootstrap/Carousel'
// import 'bootstrap/dist/css/bootstrap.min.css';
import carouselImg from '../img/carousel.png';
import carousellImg from '../img/carousel.png';


export default class CarouselBox extends Component {
    render() {
        return (
            <Carousel>
                <Carousel.Item>
                    <img  className="d-block w-100" src={ carouselImg } />
                </Carousel.Item>

                <Carousel.Item>
                <img  className="d-block w-100" src={ carousellImg } />
                <h1></h1>
            </Carousel.Item>


            </Carousel>
        )
    }
}
